    /**
     * Store a newly created resource in storage.
     *
     * @param  \Illuminate\Http\Request  $request
     * @return \Illuminate\Http\Response
     */
    public function store(Request $request)
    {
        $dataForm = $request->except(['_token']);

        $title = 'Listagem de CID10';
        
        $cid10sCAT = DB::table('cid10')->where('CAT', 'S')->get();

        $cid10Show = DB::table('cid10')->where([
            ['CID10', 'like', '%'.$dataForm['categoria'].'%'],
            ['SUBCAT', '=', 'S']
        ],)->get();

        return view('cadastros.cid10.index', compact('title','cid10sCAT','cid10Show'));

    }

